import React, { useState } from 'react';
import Header from '../../components/header';


const ModuleManage = () => {
    // 声明一个新的叫做 “count” 的 state 变量
    const [count, setCount] = useState(0);
    return (
        <div>
            <Header />
            <p>模块管理页面{count} times</p>
        </div>
    );
};

export default ModuleManage;
